import React from 'react';
import './Main.css';
import Header from './Header';
import JumboBanner from './JumboBanner';

const Main = () => {
  return (
    <div className="Main">
      <Header></Header>
      <JumboBanner></JumboBanner>
      <div className="TwoColumnGrid">
          <div className="ImgWrapper">
            <img alt="Image of mufflers" src="https://images.squarespace-cdn.com/content/v1/5e9fa98348d28b20b3f39b36/1587803065032-7X0GNQ25GDPSESU7WDN8/ke17ZwdGBToddI8pDm48kPoswlzjSVMM-SxOp7CV59BZw-zPPgdn4jUwVcJE1ZvWQUxwkmyExglNqGp0IvTJZamWLI2zvYWH8K3-s_4yszcp2ryTI0HqTOaaUohrI8PIeQMKeWYgwh6Mn73n2eZmZLHHpcPIxgL2SArp_rN2M_AKMshLAGzx4R3EDFOm1kBS/duals+pic.jpg?format=1500w"></img>
          </div>
          <h1>Services Provided</h1>
          <div className="ServicesWrapper">
            <div>-Custom Exhaust</div>
            <div>Muffler Replacement</div>
            <div>Exhaust Repair</div>
            <div>Catalytic Converter Replacement</div>
          </div>
      </div>
      {/* <div className="ThreeColumnGrid">
          <div>Yelp</div>
          <div>Services Provided</div>
          <div>Google</div>
      </div> */}
    </div>
  );
}

export default Main;
